import mechanize
import time
import pystray
from PIL import Image
import os
import io
from win10toast import ToastNotifier
from bs4 import BeautifulSoup
import base64
import http.cookiejar ## http.cookiejar in python3


img  = ''','''


nrows = 0
mypass = os.getcwd()+"/password.txt"
file = open(mypass,"r")
dt = file.read().split("\n")
image=Image.open(io.BytesIO(base64.b64decode(img)))
imgs = image.save('icon.ico')
img_path  = os.getcwd() + "/icon.ico"

def getdetails():
    cj = http.cookiejar.CookieJar()
    br = mechanize.Browser()
    br.set_cookiejar(cj)
    br.open("http://shahandanchor.com/placement/index.php")

    br.select_form(nr=0)
    br.form['reg_id'] = dt[0]  # Your Registration Number
    br.form['password'] = dt[1] # Your Password
    br.submit()
    x = br.response().read()
    soup = BeautifulSoup(x,features="html5lib")
    return soup




def quit_window(icon):
    icon.stop()
    os._exit(1)

menu=pystray.Menu( pystray.MenuItem('Quit', quit_window))
icon=pystray.Icon("Placement Notifications", image, "Placement Notifications", menu)
icon.run_detached()

    
